(window.webpackJsonp=window.webpackJsonp||[]).push([[28],{1177:function(e,o){e.exports={domain:"messages",locale_data:{messages:{"":{domain:"messages",plural_forms:"nplurals=2; plural=(n != 1)",lang:"en_CA"},"Search for anyone":[""],"Type in a name":["Type in a person's name to find them."],"This has no exclamation marks":["Welcome to the Directory Proof of Concept!"],"Self-serve contact information":[""],"Easily update your contact information so that it is always accurate. You can make changes yourself and they will show up immediately.":[""],"Easy to search":[""],"Looking for someone? Quickly find other members and start collaborating.":[""],"Clean and simple profile":[""],"Your profile is yours to complete. Add a profile photo to make it personal.":[""],"Create teams":[""],"Supervisors can create teams and self-manage members.":[""],"Organizational chart":[""],"Explore an entire team and find the exact person you need to talk to.":[""],"New interface design":[""],"A bright-blue colour scheme, rounded elements and minimalist look make the application just a little more fun to use.":[""],"Key features":[""],"What\u2019s coming next?":[""],"This is the first version of the Directory but we have big plans for the future. Below is a list of some features we have planned for development.":[""],"Please note that all these features are subject to change, as future features and improvements will depend on your feedback.":[""],"How to provide your feedback":[""],"We want your feedback to help us improve Directory and priorities new features to be developed. Before telling us what you think, play around and test out the new design and functionality of Directory. Take note of what you like, don\u2019t like, and suggestions for improvement.":[""],"We will be hosting user testing and feedback sessions where you can share what you\u2019ve discovered. Join the (x) GCcollab group and keep an eye out for the next research session on Directory.":["We will be hosting user testing and feedback sessions where you can share what you\u2019ve discovered. Join the GCcollab group and keep an eye out for the next research session on Directory."],"All about the details":[""],"This application is in its early stages. As a proof of concept, this application is not a finalized product ready for full use. It\u2019s meant to be a first version with base features so that you can add your contact info, explore, and provide your feedback.":[""],"As a functional prototype, this application is set for user testing and exploration. We will be running user testing and feedback sessions soon, so play around and take note of what you like, what you don\u2019t, and suggestions for improvement. See below for more information on how you can provide your feedback.":[""],"Because this is a proof of concept, there will be bugs in the system. If you come across a bug, don\u2019t worry. We\u2019ll be fixing bugs on a regular basis as we develop new features and improvements.":[""],"NOTE:":[""],"This application currently uses fake content so that we could accurately display certain features, such as the organizational chart. Approximately 12,000 users were randomly generated to add data to the application and show a realistic sample.":[""],"As we onboard more departments, and more public servants complete their profile, we will remove the fake content.":[""],"Automatic profile creation when you register for GCaccount, which includes your name and email address.":[""],"Approval workflow that allows supervisors to approve requests for team members and employees.":[""],"In-app notifications for items that require your attention (approvals, change requests, etc.)":[""],"Ability to choose team avatars and colours":[""],"Enhanced search functionality":[""],"One-time profile transfer from GCcollab to Directory":[""],"Integrating non-government accounts and users into Directory":[""],"Give us your Feedback":[""],"Made with Aurora":[""],"Welcome block text":["You\u2019re one of the first to check out the new Directory application proof of concept. Feel free to take a look. You can't login just yet, but more is coming soon!"]}}}}}]);
